from functools import lru_cache
import sys
sys.setrecursionlimit(999999)
class Solution:
    def numberOfWays(self, s: str) -> int:
        """
        s = "001101"
        :param s:
        :return:
        """
        pass
        ans = self.getCnt(s, '101')

        ans2 = self.getCnt(s, '010')
        return ans + ans2

    @lru_cache(None)
    def getCnt(self, s, target):

        if s == '':
            return 0
        if s == target:
            return 1
        if target == '':
            return 1


        if s[0] == target[0]:
            v1 = self.getCnt(s[1:], target[1:])
            v2 = self.getCnt(s[1:], target)
            ans = v1 + v2
            return ans
        if s[0] != target[0]:
            return self.getCnt(s[1:], target)

a = Solution()
ans1 = ''
print(a.numberOfWays(ans1))